import React from "react";

export const Tile = (props) => {

  const {name, description} = props;

  

  


  return (
    <div>
      <p className="title-title title">{name}</p>
      {Object.values(description).map((value, index)=> (
        <p key={index} className="tile">{value}</p>
      ))}
      
    </div>
  );
};
